import React from "react";
import styles from "./Faq.module.scss";

const Faq = () => {
  return (
    <section className={styles.faq}>
      <div className="container">
        <div className={styles.box}>
            <h2>FAQ</h2>
            <div className={styles.list}></div>
        </div>
      </div>
    </section>
  );
};

export default Faq;
